            {placeDetails.openingHours.weekday_text.length > 0 ? (
              <ul className="style-1">
                {placeDetails.openingHours.weekday_text.map((day, index) => (
                  <li key={index}>{day}</li>
                ))}
              </ul>
            ) : (
              <p>No opening hours available</p>
            )}
          </div>
        </div>
          </div>
          <div id="amenities" className="container mb-50">
